import React from 'react'
import firebase from 'firebase'
import app from 'firebase/app'



const config = {
    apiKey: "AIzaSyCMr-yx6sZtP4sxQVpJKgHo-k44hE8K0Ok",
    authDomain: "iot-beacon-collection.firebaseapp.com",
    databaseURL: "https://iot-beacon-collection.firebaseio.com",
    projectId: "iot-beacon-collection",
    storageBucket: "iot-beacon-collection.appspot.com",
    messagingSenderId: "841337217096",
    appId: "1:841337217096:web:59562b47652b41186eb87d",
    measurementId: "G-B5EZ2LXJMD"
  };

class Firebase extends React.Component{
    constructor(){
        app.initializeApp(config);
    }
}
const rootRef = firebase.database().ref();
const beaconRef = rootRef.child('beacon1');
const tableval = beaconRef.limitToLast(1).on('child_added',function(snapshot){
    console.log(snapshot.name(),snapshot.val());
});
export default Firebase
